import React from 'react';
import './App.css';

type Person = {
  name: string;
  age: number;
}

type TwoPersons = Person & {
  name: string,
  age: number,
}

let person: Person = {
  name: "Rafael Bamberg",
  age: 20,
}

const print = (name: string) => {
  return console.log(name)
}
print("Rafael")

const App: React.FC = () => {
  return (
    <div className="App">
    </div>
  );
}

export default App;
